import React from 'react';

import './section2.css';

import EIC from './Exchange_Info_card';


const Section2 = () => {
    return (
      <div className="container ">
        <div className="col-12">
          <div className="row main__section">
            <div className="col-4">
              <EIC />
            </div>
            <div className="col-4">
              <EIC />
            </div>
            <div className="col-4">
              <EIC />
            </div>
          </div>
        </div>
      </div>
    );
}

export default Section2
